import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";


function App() {


  return (

    <Router>
    <Topbar/>
    <Routes>
      <Route exact path="/" element={<Home/>}/>


        <Route exact path="/Write" element={<Write/>}/>





    </Routes>
    </Router>
  );
}

export default App;
